% Function to analyze a column
function counts = analyze_column(column)
    % Counting consecutive rows with the same value
    counts = zeros([1,length(column)]);
    count = 0;
    prev = 0;
    idx = 1;
    for i=1:length(column)
        curr = column(i);
        if curr == prev
            count = count + 1;
        else
            idx = idx + 1;
            counts(idx) = count;
            count = 0;
        end
        prev = curr;
    end
    counts = counts(1:idx);
end
